import React from 'react';

import './App.css';
import Header from "./components/Header"

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
         <h1>Food Receipe App</h1>
        </p>

      </header>
    </div>
  );
}

export default App;
